import React from 'react';
import Image  from '../image/amel.jpeg'
import MainContent from "../comp/MainContent";

const About = () => {

  return (
<> 

<div>
<MainContent pageName="     "  />
        <table cellspacing="20">
       <tr>
        <td> <img src={Image}/> </td>
        <td>Je m'appelle Amel Shgairi, j'ai 27 ans. j'ai étudié informatique de gestion à l'Institut maghrébin d'économie et de technologie. Et formez votre développeur web au "Go My Code" ainsi qu'aux cours en ligne. J'ai travaillé freelance pendant une année complète chez Hammamet Informatique Services depuis l'obtention de mon diplôme. Je travaille en autonomie avec mes clients pour m'occuper des pages et créer des sites e-commerce. Je gère les situations stressantes et aime travailler en équipe. J'aime dessiner et j'aime la lecture , j'aime m'amuser et rire et j'aime ma personnalité positive, Je ne suis pas parfait mais je travaille pour m'améliorer</td>
       </tr> 
    </table>
      
    

    </div>
  
  
  </>
  );
}

export default About;
